import React from 'react';
import ImageButton from '../atoms/imageButton';
import './sidebar.css';
import Img from '../../resource/image/friendIcon.png';

function Header() : any {
  const btnCss = {
    'padding': '21px'
  }
  return (
    <div className="sidebar">
      <ImageButton imageSrc={Img} alt={'친구'} css={btnCss}/>
      <ImageButton imageSrc={Img} alt={'친구'} css={btnCss}/>
    </div>
  );
}

export default Header;
